)c([ID],[DevProjectID],[Name],[Title],[Details]))
merge	[genericdata].[DataTransformationDefinition] as t
using	cte_data as s
on		1=1 and t.[ID] = s.[ID]
when matched then
	update set
	[DevProjectID] = s.[DevProjectID],[Name] = s.[Name],[Title] = s.[Title],[Details] = s.[Details]
when not matched by target then
	insert([ID],[DevProjectID],[Name],[Title],[Details])
	values(s.[ID],s.[DevProjectID],s.[Name],s.[Title],s.[Details]);



